import React, { Component } from 'react';

class Received extends Component {
    constructor() {
        super();
        this.state= {
            order:[]
        }
    }
    componentDidMount() {
        fetch('./json/open.json').then(results=> {
            return results.json();
        }).then(data=>{
            console.log(data);
        })
    }
    nextPath(path) {
        this.props.history.push(path);
    }
    render() {
        return(
            <div>
                <div className="pro-header">
                    <div className="p-2 mr-auto">
                        <div className="input-group md-form form-sm form-2 pl-0">
                            <input className="form-control my-0 py-1 red-border" type="text" placeholder="Search"
                                   aria-label="Search"/>
                        </div>
                    </div>
                </div>
                <div className="dchannel-content">
                    <div style={{ padding: "10px"}}>
                        <table style={{ width: "100%"}}>
                            <thead>
                            <tr>
                                <th>Date</th>
                                <th>Buyer Name</th>
                                <th>
                                    <select name="" id="">
                                        <option value="">Cash</option>
                                        <option value="">Credit</option>
                                        <option value="">Consignment</option>
                                    </select>
                                </th>
                                <th>
                                    <select name="" id="">
                                        <option value="">Pazundaung</option>
                                        <option value="">Kyaukdata</option>
                                    </select>
                                </th>
                                <th>Order Ref No</th>
                            </tr>
                            </thead>
                            <tbody>
                            <tr onClick={() => this.nextPath('/dashboard/order/received-detail') }>
                                <td>04-09-2019</td>
                                <td>Mya Mya</td>
                                <td>cash</td>
                                <td>Kyaukdata</td>
                                <td>1</td>
                            </tr>
                            <tr onClick={() => this.nextPath('/dashboard/order/received-detail') }>
                                <td>04-09-2019</td>
                                <td>Mya Mya</td>
                                <td>Credit</td>
                                <td>Pazundaung</td>
                                <td>1</td>
                            </tr>
                            </tbody>
                        </table>
                    </div>
                </div>

            </div>
        );
    }
}

export default Received;
